    protected container getNotesMetaData(str _formatID)
    {
        container   notesList;

        //Metadata column names of data elements
//FormatId,PaymSpec,Note

        switch (_formatID)
        {
            case ('EU-DANSKEBANK-XML-FI'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_FI();
                break;

            case ('EU-DANSKEBANK-XML-INT'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_INT();
                break;

            case ('EU-DANSKEBANK-XML-DK'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_DK();
                break;

            case ('EU-DANSKEBANK-XML-NO'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_NO();
                break;

            case ('EU-DANSKEBANK-XML-SE'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_SE();
                break;

            case ('EU-DANSKEBANK-XML-PL'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_PL();
                break;

            case ('EU-DANSKEBANK-XML-BE'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_BE();
                break;

            case ('EU-DANSKEBANK-XML-NL'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_NL();
                break;

            case ('EU-DANSKEBANK-XML-UK'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_UK();
                break;

            case ('EU-DANSKEBANK-XML-IE'):
                notesList = this.getNotesMetaData_EU_DANSKEBANK_XML_IE();
                break;

        }

        return notesList;

    }

