    protected container getValidationsMetaData(str _formatID)
    {
        container   validationsList;

        //Metadata column names of data elements
//FormatId,PaymSpec,Id,SourceFieldDesc,SourceFieldLoc,TargetFieldLoc,Notes,SourceContext,SourceField,ISOCountrySpec,CountryContext,Required,LengthValidation,MinLength,MaxLength,UserUpdated,Module

        switch (_formatID)
        {
            case ('EU-DANSKEBANK-XML-FI'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_FI();
                break;

            case ('EU-DANSKEBANK-XML-INT'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_INT();
                break;

            case ('EU-DANSKEBANK-XML-DK'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_DK();
                break;

            case ('EU-DANSKEBANK-XML-NO'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_NO();
                break;

            case ('EU-DANSKEBANK-XML-SE'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_SE();
                break;

            case ('EU-DANSKEBANK-XML-PL'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_PL();
                break;

            case ('EU-DANSKEBANK-XML-BE'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_BE();
                break;

            case ('EU-DANSKEBANK-XML-NL'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_NL();
                break;

            case ('EU-DANSKEBANK-XML-UK'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_UK();
                break;

            case ('EU-DANSKEBANK-XML-IE'):
                validationsList = this.getValidationsMetaData_EU_DANSKEBANK_XML_IE();
                break;

        }

